def min\_coins(coin\_values, change):
coins = [0] \* (change + 1)
coins[0] = 0
for amt in range(1, change + 1):
min\_coin\_amount = float('inf')
for cv in coin\_values:
if amt >= cv:
num\_coins = coins[amt - cv] + 1
if num\_coins < min\_coin\_amount:
min\_coin\_amount = num\_coins
coins[amt] = min\_coin\_amount
return coins[change]

coin\_values = [1, 5, 10, 25]
change = 96
print(min\_coins(coin\_values, change))
